import React from "react";
import { Route } from "react-router-dom";
import HeaderHome from "../Components/Header/HeaderHome";
import FooterHome from "../Components/Footer/FooterHome";
import bg from '../Pages/Authentication/authbg.png';
import Sidebar from "../Components/Sidebar";
import HeaderDashboard from "../Components/Header/HeaderDashboard";
/* PrivateRoute is for all Users & Visitor */ 
export var HomeRoute = ({ component: Component, ...rest }) => {
  return (
    <Route
      {...rest}
      render={(props) =>
        <React.Fragment>
          <HeaderHome />
          <Component {...props} />
          <FooterHome />
        </React.Fragment>
      }
    />
  );
};

/* PrivateRoute is for all Users & Visitor */ 
export var AdminRoute = ({ component: Component, ...rest }) => {
  return (
    <Route
      {...rest}
      render={(props) =>
        <React.Fragment>
          <div className="d-flex layout-wrapper">
            <Sidebar />
            <div className="layout-content">
              <HeaderDashboard />
              <Component {...props} />
            </div>
          </div>
        </React.Fragment>
      }
    />
  );
};

/* PrivateRoute is for all Authentication [NOT LOGIN MEMBERS ONLY] */ 
export var AuthRoute = ({ component: Component, ...rest }) => {
  return (
    <Route
      {...rest}
      render={(props) =>
        <div className="auth-page" style={{ backgroundImage: `url('${bg}')` }}>
          <div className="container">
            <div className="row justify-content-center align-items-center">
              <div className="col-xl-8">
                <div className="auth-page-box shadow-sm rounded-md overflow-hidden">
                  <div className="row no-gutters">
                    <div className="col-md-6 auth-page-banner bg-gradient-primary text-center">
                      <div className="d-flex h-100 align-items-center justify-content-center">
                        <div className="middle-content p-5 text-light">
                          <h1 className="text-uppercase text-white">ZI Academy</h1>
                          <div>Beyond Learning</div>
                        </div>
                      </div>
                    </div>
                    <div className="col-md-6 order-md-first">
                      <div className="p-5 auth-page-content">
                        <Component {...props} />
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      }
    />
  );
};
